CREATE DEFINER=`cchcorre`@`localhost` PROCEDURE `prc_actualizarestadolote` (IN `P_codLote` INT, IN `P_estadoRegistro` VARCHAR(1), IN `P_usuario` VARCHAR(30))  BEGIN
