    UPDATE loteproductos
       set estadoCierre = P_estadoRegistro,
           fechaModificacion = CURDATE(),
           usuarioModificacion = P_usuario
     where codLote = P_codLote;


END$$

CREATE DEFINER=`cchcorre`@`localhost` PROCEDURE `prc_actualizarEstadoProducto` (IN `P_codProducto` INT, IN `P_estadoRegistro` VARCHAR(1), IN `P_usuario` VARCHAR(30))  BEGIN
DECLARE V_codLiquidacion INT;
DECLARE V_fechaLiquidacion date;

SELECT
    codLiquidacion
INTO V_codLiquidacion FROM
    liquidacionproducto
WHERE
    codProducto = P_codProducto
        AND estadoRegistro = 'S';

SELECT
    fecha
INTO V_fechaLiquidacion FROM
    liquidacion
WHERE
    codLiquidacion = V_codLiquidacion
        AND estadoRegistro = 'S';

UPDATE depositoproducto
set estadoRegistro = 'R'
where codProducto = P_codProducto
and estadoRegistro = 'L';

UPDATE producto
SET
    estadoRegistro = P_estadoRegistro
WHERE
    codProducto = P_codProducto;

