usuarioModificacion = P_usuario,
fechaModificacion = CURDATE()
where codLiquidacion = V_codLiquidacion
and codProducto = P_codProducto
and estadoRegistro = 'S';

values(P_estadoRegistro,V_fechaLiquidacion,P_codProducto,CURDATE(),P_usuario);

END$$

CREATE DEFINER=`cchcorre`@`localhost` PROCEDURE `prc_actualizarproducto` (IN `P_codigo` INT, IN `P_numero` INT, IN `P_lote` INT(11), IN `P_tipo` VARCHAR(1), IN `P_proveedor` INT(11), IN `P_poliza` VARCHAR(50), IN `P_usuario` VARCHAR(0))  BEGIN
declare V_estadoActual varchar(1);
declare V_lote int(11);
declare V_estadoRegistro varchar(1);

SELECT 
    estadoRegistro, codLote
INTO V_estadoActual , V_lote FROM
    producto
WHERE
    codProducto = P_codigo;

if V_estadoActual = 'V' and V_lote <> P_lote then
	set V_estadoRegistro = 'S';
else
    set V_estadoRegistro = V_estadoActual;
end if;

UPDATE producto 
SET 
    numeroCertificado = P_numero,
    tipo = P_tipo,
    codLote = P_lote,
    codPersona = P_proveedor,
    numeroPoliza = P_poliza,
    fechaModificacion = CURDATE(),
    usuarioModificacion = P_usuario,
    estadoRegistro = V_estadoRegistro
WHERE
    codProducto = P_codigo;
        
END$$

