CREATE DEFINER=`cchcorre`@`localhost` PROCEDURE `prc_validarcerradolote` (IN `P_codLote` INT, OUT `PO_estadoRegistro` VARCHAR(1))  BEGIN
DECLARE V_cantCerrados INT;
DECLARE V_cantEV INT;

select count(distinct (codProducto))
  into V_cantCerrados
  from producto
 where estadoRegistro in ('S','R','A','V')
   and codLote =  P_codLote
   and codProducto in (
                      select codProducto
                        from depositoproducto
                       where estadoRegistro in ('R','L','F'));


select count(distinct(codProducto))
  into V_cantEV
  from producto
 where codLote =  P_codLote;

if V_cantEV = V_cantCerrados then
    set PO_estadoRegistro = 'S';
else
    set PO_estadoRegistro = 'N';
end if;

END$$

